        {
            result = true;
        }
        else if (pcr.pcr_type == "02" && (pcr.pcr_status == "C" || pcr.pcr_status == "P") && pcr.pcr_month_start == "01" && pcr.pcr_month_end == "12" && string.IsNullOrEmpty(pcr.pcr_arh_code))
